:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  I DAVIES, George Henry and GODFREY, Rose Alma
  DAVIES, George Henry and GODFREY, Rose Alma (cont...)
  George was recognised as a poet, raconteur and wit and an enthusiastic follower of rugby football. He was also
  reputed to know the entire history of the Welsh Fusiliers off by heart. The Free Lance recorded that when Wales
  defeated the All Blacks in 1905 he drew a widely-circulated cartoon of the Billy-Goat of Wales knocking out the
  Moa of New Zealand. The picture carried the caption, "Nec moa terrent" (not even the moas alarm us); giving a
  new twist to the motto of the Welsh Fusiliers, "Nec aspera terrent" (not even difficulties frighten us).
  Rose was actively involved in the affairs of St Mary's Church, Karori.
  01> DAVIES, George William Godfrey m on 26.12.1914 to KELLY, Nora Creina
  b 18.07.1882 d 06.03.1946
  b 13.04.1894 d 04.08.1984
  George b. at Wellington and m. at Taumarunui. Nora, d/o John Douglas Kelly (engineer and farmer) and Mary
  Ann Taylor, b, at Manukau, Wellington. Both d. at Auckland and cremated and ashes interred in the family
  plot at Purewa Cemetery. Nora remarried in 1946 to Alfred Dibley.
  George won a scholarship to attend Wanganui Collegiate School and graduated with Honours in five subjects.
  He entered the insurance industry and was manager for AMP in Napier at the time of the earthquake in 1931.
  He retired about 1945 as Otago District Manager of AMP. He was a New Zealand hockey rep in the early 1900's
  and was co-founder of the Karori Hockey Club. He served in WW1 and was a member of the Medical Corps. He
  was mentioned for services rendered during the Napier earthquake of 1931. He was a fluent Maori speaker.
  Nora was remembered as a charming hostess and exceptional cook. She was a good golfer and bridge and
  canasta expert.
  01> DAVIES, Gwen Rosemary Alma m on 18.07.1944 to ARNOLD, Edgar Lamson Jnr
  b 01.09.1923 d 20.09.1987
  b 10.08.1915
  Gwen b. at Palmerston North and d. at St Petersburg Beach, Florida, USA. Edgar, s/o Edgar Lamson Arnold
  and Martha F Cook, b. at Woonsocket, RI, USA. Address: 500 Park Boulevard, 3/78 Venice, Florida 34285,
  USA.
  Edward was educated in Rhode Island and obtained an MS degree from Rhode Island State College in 1941.
  He was a Lieutenant in the US Coast Guard in the Pacific theatre in WW2. He then entered the US Civil
  Service as a research biologist in 1946, working in New England aboard a marine research vessel
  (1950-60). He transferred to St Petersburg in 1960 and retired there in 1975.
  Edgar remarried on 31.08.1991 to Janice Donaldson and moved to Hanover, NH.
  01> ARNOLD, Laurence Edward m on ** ** **** to (1)??, Dorian
  b 05.07.1947
  b ** ** ****
  Laurence b. at Woonsocket, RI, USA. He grew up in Texas and Florida and obtained an MS degree from
  the University of Tampa in 1969. He was deputy city manager of St Petersburg until 1991 when he
  left to become the President of Sterilization Techniques, Inc, a firm dealing with waste problems.
